import React from 'react';
type HeadingProps = {
    children: string
    content: string
}
const Heading = ({ children, content }: HeadingProps) => {
    return (
        <div>
            <h3>{ children }</h3>
            <h3>{ content }</h3>
        </div>
    );
};

export default Heading;
